const NumInput = ({label, name, value, valueChanged, onChange, min, max}) => {
    return (
        <label>{label} 
            <input 
            key="num-input"
            type="number" 
            name={name}
            value={value}
            onChange={onChange}
            min={min}
            max={max}
            id={value > max || value < min ? "error" : valueChanged ? value.length > 0 ? "no-error" : "error" : null}
            //id={ resorts.has(value.toLowerCase()) === true ? "error" : valueChanged ? value.length > 0 ? "no-error" : "error" : null }
            />
        </label>
    )
}

export default NumInput;
